import ExpenseItem from "./ExpenseItem";

function Expenses(props){

    const expense_array = props.expenses;

    return (
        <div className="expenses">
          <ExpenseItem 
            date={propexpense_array[0].date}
            title={expense_array[0].title}
            amount={expense_array[0].amount}
          />
          <ExpenseItem
            date={expense_array[1].date}
            title={expense_array[1].title}
            amount={expense_array[1].amount}
          />
          <ExpenseItem
            date={expense_array[2].date}
            title={expense_array[2].title}
            amount={expense_array[2].amount}
          />
          <ExpenseItem
            date={expense_array[3].date}
            title={expense_array[3].title}
            amount={expense_array[3].amount}
          />
        </div>
      );
}

export default Expenses;
